import React from 'react';

export default function Restaurants({ restaurants }) {
  console.log(restaurants);

  return (
    <div>
      <h2>Local Restaurants</h2>
      <p>Local Restaurants you should check out:</p>
      <div className="row">
        {restaurants.map((restaurant) => (
          <div key={restaurant.id} className="col s12 m6">
            <div className="card">
              <div className="card-image">
                <img src={restaurant.image} alt={restaurant.name} />
                <span className="card-title">{restaurant.name}</span>
                <a href="#" className="btn-floating halfway-fab waves-effect waves-light red">
                  <i className="material-icons">add</i>
                </a>
              </div>
              <div className="card-content">
                <p>{restaurant.description}</p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
